import React, { useContext } from "react";

const Header = () => {
  
    return (
            <div className="card header">
                <div className="col s12 m6">
                <div className="card white waves-light red-text">
                    <div className="card-content ">
                    <span className="card-title">!ברוכים הבאים</span>
                    <p>
                    כמה ציוד פשוט יושב לך בבית ואף אחד לא משתמש בו? "תשתמש אל תדאג" היא דרך מהפכנית להרוויח כסף נוסף על דברים שכבר בבעלותך
                    </p>
                    <p>
                    !הירשם עכשיו
                    </p>
                    </div>
                </div>
                </div>
            </div>
    );
};

export default Header;
